                         Art of Basic Drawing - 2010kaiser
                         ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~


This compilation of some of the most popular titles in our How to Draw and Paint Series gives artists the perfect introduction to drawing. The Art of Basic Drawing contains fundamental information about tools and techniques, as well as a number of inspiring step-by-step lessons. From realistic still lifes to beautiful landscapes, artists will find a variety of subject material to enjoy. And with instruction from five different accomplished artists, this book showcases a range of styles for beginners to imitate.

Author: Walter Foster
Year: 2005
ISBN: 1560109130
Format: PDF


